	UPDATE tbl_ventas AS v SET v.dteVenta = NEW.numeroDTE,
											  v.notaFactura = 'Consumidor final'
	WHERE v.idVenta = NEW.idHoja;
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

